import React, { createContext } from 'react'
import Restuarant from './Restuarants/Restuarant';
import Header from './Header';
import { Route, Routes } from 'react-router-dom';
import Number from './Number/Number';
import NumberRed from './NumberReducer/NumberRed';
import TodoList from './TodoList/TodoList';
import Home from './Home';



const App = () => {
  const userDetails = JSON.parse(localStorage.getItem('subscribers'));
  console.log(Object.entries(userDetails))

  const UserData = createContext(userDetails);

  return (
    <>
      <UserData.Provider>
        <Header />
        <div className='content'>
          <Routes>
            <Route path='/' element={<Home />} />
            <Route path='/restuarant' element={<Restuarant />} />
            <Route path='/number' element={<Number />} />
            <Route path='/number-with-reducer' element={<NumberRed />} />
            <Route path='/todo-list' element={<TodoList />} />
          </Routes>
        </div>
      </UserData.Provider>
    </>
  )
}

export default App
